//SPDX-License-Identifier: MIT

pragma solidity 0.7.5;
pragma abicoder v2;

import "./utils/SafeMath.sol";
import "./utils/Ownable.sol";

/*
* import "./utils/Address.sol";
* import "./utils/Common.sol";
*/

// A sample implementation of core ERC666 function, and NFT, SFT, FT token minting and burning.
contract ERC666 is Ownable{
    using SafeMath for uint256;
/*  using Address for address; */
/* @dev metadata will be onChain. NFT has fixed supply at 1, total supply is total of NFT.  SFT has flexible supply but can become Non fungible. FT has flexible supply.
*/
    uint public _FT = 0;

    uint public _SFT = 1;
    uint public _categorySFTgear = 1;
    uint public _categorySFTbrutes=0;

    uint public _NFT = 2;
    uint public _categoryNFTbrutes=0;
    uint public _categoryNFTgear = 1;

    /* for the moment , 0 = fungible token, 1 = sft , 2 = nft */
    bytes4[] public tokenTypeIndex;
    bytes4 internal SemiFungibleToken = bytes4(keccak256(abi.encodePacked("SemiFungibleToken")));
    bytes4 internal FungibleToken = bytes4(keccak256(abi.encodePacked("FungibleToken")));
    bytes4 internal NonFungibleToken = bytes4(keccak256(abi.encodePacked("NonFungibleToken")));

    mapping (address=> bool) private administrator;//verify if address has admin rights
    mapping (uint256 => mapping(uint256 =>  address)) public OwnerOf;  //returns the address of the owner of an NFT
    mapping (address=> mapping(address => bool)) public allowedOperator; // les address des gens styls
    mapping (uint256 => mapping(uint256 => uint256)) public totalSupply;   // to keep track of each SFT and FT totalsupply: 1) tokentype 2) id 3) supply
    mapping (uint256 => mapping(address => mapping(address => uint256))) public allowances;  // keep track of allowances : 1) id of FT (only) 2) from 3) to 4) allowance
    mapping (uint256 => mapping(uint256 => mapping(address => uint256))) public balanceOfType; // all of the balances: 1) tokentype 2) id 3) address owner 4) balance

    constructor() {
        tokenTypeIndex.push(FungibleToken);
        tokenTypeIndex.push(SemiFungibleToken);
        tokenTypeIndex.push(NonFungibleToken);

        _FT = 0;
        _SFT = 1;
        _NFT = 2;

        _categorySFTbrutes=0;
        _categorySFTgear = 1;

        _categoryNFTbrutes=0;
        _categoryNFTgear = 1;
        
    }

    modifier notZeroAddress(address _to){
        require(_to != address(0x0), "_owner must be non-zero.");
        _;
    }

    modifier onlyAdmin(){
        require (administrator[msg.sender]==true, "not allowed");
        _;
    }

    modifier isAllowed(address _from){
        require(_from == msg.sender || allowedOperator[_from][msg.sender] == true || administrator[msg.sender] == true); //or allowed address
        _;
    }
      
    /**
     * @notice create and mint token
     * @dev if minting NFT amount 'MUST' be equal to 1
     */
    function _mint(uint256 _tokenTypeIndex, uint _category, address _owner ,uint _amount) internal notZeroAddress(_owner) {
        if(tokenTypeIndex[_tokenTypeIndex] == NonFungibleToken ) {
            _amount = 1;
            }
        totalSupply[_tokenTypeIndex][_category] = totalSupply[_tokenTypeIndex][_category].add(_amount); 
        balanceOfType[_tokenTypeIndex][_category][_owner] = balanceOfType[_tokenTypeIndex][_category][_owner].add(_amount);
    }
    
    function _burn(uint256 _tokenTypeIndex, uint _category, address _owner ,uint _amount) internal notZeroAddress(_owner) {
        if(tokenTypeIndex[_tokenTypeIndex] == NonFungibleToken ) {
            _amount = 1;
        }
        totalSupply[_tokenTypeIndex][_category] = totalSupply[_tokenTypeIndex][_category].sub(_amount);  
        balanceOfType[_tokenTypeIndex][_category][_owner] = balanceOfType[_tokenTypeIndex][_category][_owner].sub(_amount); 
    }
    
    function transferSingle(uint256 _tokenTypeIndex, address _from, uint _category, address _to ,uint _amount) public isAllowed(_from) notZeroAddress(_to) {
        if(tokenTypeIndex[_tokenTypeIndex] == NonFungibleToken ) {_amount = 1;}
        balanceOfType[_tokenTypeIndex][_category][_from] = balanceOfType[_tokenTypeIndex][_category][_from].sub(_amount);
        balanceOfType[_tokenTypeIndex][_category][_to] = balanceOfType[_tokenTypeIndex][_category][_to].add(_amount);
    }

    function transferBatch(uint[] memory _tokensTypeIndex, uint[] memory _categories, address _from, address[] memory _toList, uint[] memory _amounts) isAllowed(_from) external {
        require(_tokensTypeIndex.length == _categories.length && _toList.length == _amounts.length && _tokensTypeIndex.length == _toList.length);
        uint _tokenType;
        uint _id;
        address _to;
        uint _amount;
        for(uint i = 0; i < _categories.length; i++) {
            require(_toList[i] != address(0x0), "_owner must be non-zero.");
            _tokenType = _tokensTypeIndex[i];
            _id = _categories[i];
            _to = _toList[i];
            _amount = _amounts[i];
            balanceOfType[_tokenType][_id][msg.sender] = balanceOfType[_tokenType][_id][msg.sender].sub(_amount);
            balanceOfType[_tokenType][_id][_to] = balanceOfType[_tokenType][_id][_to].add(_amount);
        }
    }

    function balanceOf(uint _tokenType, uint _category) public view returns (uint){
        return balanceOfType[_tokenType][_category][msg.sender];
    }

    function getOwnerOf(uint _category,uint _id) external view returns(address) {
        return OwnerOf[_category][_id];
    }

    function allowOperator(address _operator) external {
        allowedOperator[msg.sender][_operator] = true;
    }

    function giveAdminRights(address _newAdmin) external onlyOwner {
        administrator[_newAdmin] = true;
    }
}
